// src/pages/EditPackages.js
import React, { useEffect, useState } from 'react';

export default function EditPackages() {
  const [packages, setPackages] = useState([]);
  const [newPackages, setNewPackages] = useState({});

  // Fetch all packages
  useEffect(() => {
    fetch('http://localhost:5001/packages')
      .then(res => res.json())
      .then(data => setPackages(data))
      .catch(err => console.error('Error fetching packages:', err));
  }, []);

  const handleInputChange = (index, field, value) => {
    setNewPackages(prev => ({
      ...prev,
      [index]: {
        ...prev[index],
        [field]: value
      }
    }));
  };

  const handleAddPackage = async (index) => {
    const pkg = newPackages[index];
    if (!pkg?.destination || !pkg?.price || !pkg?.duration || !pkg?.activities) {
      alert('All fields are required');
      return;
    }

    const response = await fetch('http://localhost:5001/packages', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({
        destination: pkg.destination,
        price: Number(pkg.price),
        duration: Number(pkg.duration),
        activities: pkg.activities.split(',').map(act => act.trim())
      })
    });

    if (response.ok) {
      const data = await response.json();
      setPackages(prev => [...prev, { ...pkg, _id: data.package_id }]);
      setNewPackages(prev => {
        const updated = { ...prev };
        delete updated[index];
        return updated;
      });
    } else {
      alert('Failed to add package');
    }
  };

  const handleDelete = async (id) => {
    const response = await fetch(`http://localhost:5001/packages/${id}`, {
      method: 'DELETE'
    });

    if (response.ok) {
      setPackages(prev => prev.filter(pkg => pkg._id !== id));
    } else {
      alert('Failed to delete package');
    }
  };

  return (
    <div className="p-6">
      <h2 className="text-3xl font-bold mb-6 text-center">Edit Packages</h2>
      <div className="space-y-8">
        {packages.map((pkg, index) => (
          <div key={pkg._id} className="bg-white shadow p-4 rounded-lg">
            <div className="grid grid-cols-5 gap-4 items-center mb-2">
              <div><strong>Destination:</strong> {pkg.destination}</div>
              <div><strong>Price:</strong> ${pkg.price}</div>
              <div><strong>Duration:</strong> {pkg.duration} days</div>
              <div><strong>Activities:</strong> {pkg.activities?.join(', ')}</div>
              <button
                onClick={() => handleDelete(pkg._id)}
                className="bg-red-500 text-white px-4 py-1 rounded hover:bg-red-600"
              >
                Delete
              </button>
            </div>

            <div className="grid grid-cols-5 gap-4 items-center mt-4">
              <input
                type="text"
                placeholder="Destination"
                className="border p-2 rounded"
                onChange={(e) => handleInputChange(index, 'destination', e.target.value)}
              />
              <input
                type="number"
                placeholder="Price"
                className="border p-2 rounded"
                onChange={(e) => handleInputChange(index, 'price', e.target.value)}
              />
              <input
                type="number"
                placeholder="Duration (days)"
                className="border p-2 rounded"
                onChange={(e) => handleInputChange(index, 'duration', e.target.value)}
              />
              <input
                type="text"
                placeholder="Activities (comma separated)"
                className="border p-2 rounded"
                onChange={(e) => handleInputChange(index, 'activities', e.target.value)}
              />
              <button
                onClick={() => handleAddPackage(index)}
                className="bg-blue-600 text-white px-4 py-2 rounded hover:bg-blue-700"
              >
                Add Package
              </button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}
